import Chatbot from 'react-chatbot-kit';
import 'react-chatbot-kit/build/main.css';

function App() {
  return (
    <div className="App flex justify-center items-center h-screen">
      <header className="App-header w-3/4 md:w-1/2 lg:w-1/3 xl:w-1/4">
        <Chatbot />
      </header>
    </div>
  );
}

export default App;
